ノア・ヴォクシー・エスクァイア専用フロントガラス用サンシェード<br>キルトで断熱＆UVカット！<br>消臭抗菌加工で車内さわやか！<br><br>【リバーシブルタイプ】<br>・おしゃれで高級感のあるキルト<br>・熱と光を跳ね返すシルバー<br><br><br>【適合型式】<br>ZWR80系 ハイブリッド車<br>ZRR30系ガソリン車<br>ZRR85系4WD車<br>※その他の型式のノア・ヴォクシー・エスクァイアにはご使用できません。<br><br>本体サイズ：1390(W)×965(H)mm<br>材質：アルミニウム パウダーコート、ポリエステル 210デニール<br><br>メーカー品番：NVK-80<br>メーカー：大自工業/メルテック<style type="text/css">
