自動車のフロントガラス用サンシェード<br>UVと熱をダブルブロック<br><br><br>●2倍の空気層で強力断熱&消臭抗菌<br>●強力断熱&UVカットで車内を守る！<br><br><br>【仕様】<br>本体サイズ：LLサイズ 約1400（W）×900（H）mm<br>材質：アルミニウム パウダーコート<br>吸盤：2個<br>重さ：約450g<br>メーカー：大自工業 Meltec<br>品番：PBW-23<br><br><br>【サンシェード適合目安】<br>●トヨタ<br>アルファード、ヴェルファイア、ヴォクシー<br>エスクァイア、エスティマ、ノア<br>●ホンダ<br>オデッセイ、ステップ ワゴン<br>●ニッサン<br>セレナ<br>●マツダ<br> ビアンテ<br> ●ミツビシ<br> デリカ D：5<br> ●スバル<br> ランディ<style type="text/css">
